import React from 'react';

const LinkedInLogo = ({ className }) => {
    return(<svg className={className} width="21" height="21" viewBox="0 0 21 21" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
    <rect width="21" height="21" fill="url(#pattern0)"/>
    <defs>
    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
    <use xlinkHref="#image0_291_116" transform="scale(0.0104167)"/>
    </pattern>
    <image id="image0_291_116" width="96" height="96" xlinkHref="data:image/png;base64,"/>
    </defs>
    </svg>
)
}
export default LinkedInLogo;
